<script>
	const map = $("#map")
	colorMap.forEach((row) => {
		const rowEl = $("<div class='row'></div>")

		row.forEach((cell) => {
			const cellEl = $(`<div class='cell' style='background-color: ${cell.rgb}'></div>`)
			rowEl.append(cellEl)
		})

		map.append(rowEl)
	})

	const imgMap = $("#map-img")
	colorMap.forEach((row) => {
		const rowEl = $("<div class='row'></div>")

		row.forEach((cell) => {
			const cellEl = $(`<img loading="lazy" class='cell' src="../output/resized_images/tidy/${cell.videoID}.jpg" />`)
			rowEl.append(cellEl)
		})

		imgMap.append(rowEl)
	})
</script>
